function Home(props) {
  return (
    <div className="container">
      <div className="home-text">
        <p className="name">
          Born and raised in Rancho San Diego, I spent most of my childhood
          either playing some sort of video game or skateboarding with my
          friends.
        </p>
      </div>
    </div>
  );
}

export default Home;
